import React from "react";
import {
  Grid,
  Card,
  Typography,
  Button,
  CardActions,
  Box,
} from "@mui/material";
import "./featureProducts.scss";

const FeaturedProducts = () => {
  return (
    <section className="featured-products">
      <Grid container spacing={1}>
        {productsList.map((item, index) => (
          <Grid item xs={12} sm={6} md={3} key={index} mb={2}>
            <Card
              className="product-card"
              sx={{
                height: 400,
                width: "100%",
                backgroundImage: `url(${item.img})`,
                backgroundSize: "cover",
                backgroundPosition: "center",
                position: "relative",
              }}
            >
              {/* <div class="product-image">
                <img src={item.img} alt="Product Image" />
              </div> */}
              <CardActions
                className="cardContent"
                sx={{
                  position: "absolute",
                  bottom: 0,
                  width: "100%",
                  padding: "16px",
                }}
              >
                <Box
                  sx={{
                    flexGrow: 1,
                    textAlign: "center",
                    padding: "8px",
                  }}
                >
                  <Typography variant="h5" className="product-title">
                    {" "}
                    {item.title}{" "}
                  </Typography>

                  <Button variant="outlined" className="btnBuy">
                    Buy Now
                  </Button>
                </Box>
              </CardActions>
            </Card>
          </Grid>
        ))}
      </Grid>
    </section>
  );
};

const productsList = [
  {
    img: "https://img.freepik.com/free-photo/studio-close-up-portrait-young-fresh-blonde-woman-brown-straw-poncho-wool-black-trendy-hat-round-glasses-looking-camera-green-leather-had-bag_273443-1121.jpg?ga=GA1.1.283113086.1700578772&semt=ais_hybrid",
    title: "Breakfast",
    author: "@bkristastucchio",
    featured: true,
  },
  {
    img: "https://img.freepik.com/free-photo/portrait-beautiful-stylish-young-woman_158538-4020.jpg?ga=GA1.1.283113086.1700578772&semt=ais_hybrid",
    title: "Burger",
    author: "@rollelflex_graphy726",
  },
  {
    img: "https://images.unsplash.com/photo-1522770179533-24471fcdba45",
    title: "Camera",
    author: "@helloimnik",
  },
  {
    img: "https://images.unsplash.com/photo-1444418776041-9c7e33cc5a9c",
    title: "Coffee",
    author: "@nolanissac",
  },
  {
    img: "https://images.unsplash.com/photo-1533827432537-70133748f5c8",
    title: "Hats",
    author: "@hjrc33",
  },
  {
    img: "https://images.unsplash.com/photo-1558642452-9d2a7deb7f62",
    title: "Honey",
    author: "@arwinneil",
    featured: true,
  },
  {
    img: "https://images.unsplash.com/photo-1516802273409-68526ee1bdd6",
    title: "Basketball",
    author: "@tjdragotta",
  },
  {
    img: "https://images.unsplash.com/photo-1518756131217-31eb79b20e8f",
    title: "Fern",
    author: "@katie_wasserman",
  },
  {
    img: "https://images.unsplash.com/photo-1597645587822-e99fa5d45d25",
    title: "Mushrooms",
    author: "@silverdalex",
  },
  {
    img: "https://images.unsplash.com/photo-1567306301408-9b74779a11af",
    title: "Tomato basil",
    author: "@shelleypauls",
  },
  {
    img: "https://images.unsplash.com/photo-1471357674240-e1a485acb3e1",
    title: "Sea star",
    author: "@peterlaster",
  },
  {
    img: "https://images.unsplash.com/photo-1589118949245-7d38baf380d6",
    title: "Bike",
    author: "@southside_customs",
  },
];

export default FeaturedProducts;
